import React from 'react';
import Imaginante from './ima.js';



function TableI(){
    const [data, setData] = React.useState(null);
    React.useEffect(() => {
        fetch("/api/imaginantes")
          .then((res) => res.json())
          .then((data) => setData(data));
      }, []);
      const tableI = data?.map(imaginante =>
        <Imaginante matricula = {imaginante.matricula} nombre = {imaginante.nombre} grupo ={imaginante.grupo} correo = {imaginante.correo}/>
    ); 
    return(
        <div>
        <table className="table table-hover table-dark">
            <thead>
            <tr>
                <th scope="col">Matricula</th>
                <th scope="col">Nombre</th>
                <th scope="col">Grupo</th>
                <th scope="col">Correo</th>
            </tr>
            </thead>
            <tbody>
            {tableI} 
            </tbody>
        </table>
    </div>
        
    );
};
export default TableI;

